        "age" :"62",
        "hairColor" :"Brown"
      },
    ]

    return (
      <div className="App">
        <Nav link="components/nav.js"> <p className='nav-item'>child 1</p> <p className='nav-item'>child 2</p> 
        </Nav> {/* S : 2 */}
        {users.map()}
        <PersonCard     />
      </div>
    );
  }
}

export default App;
